Build a Rust program that calculates the sum of all even integers between two given numbers. The program should use a for loop to iterate over the range of numbers and a conditional statement to check if the number is even. The program should print the sum of all even numbers in the range.

## 🚀 Solution

Here is a solution in Rust:
```
fn main() {
    let mut sum = 0;

    for i in 1..=10 {
        if i % 2 == 0 {
            sum += i;
        }
    }

    println!("Sum of all even numbers in the range: {}", sum);
}
```
